import React from 'react';

import { Swiper, SwiperSlide } from "swiper/react";

// Import Swiper styles
import "swiper/css";
import "swiper/css/pagination";
import { Pagination } from "swiper";

function LatestProducts() {
    return (
        <>
        <Swiper
        slidesPerView={3}
        spaceBetween={30}
        pagination={{
          clickable: true,
        }}
        modules={[Pagination]}
        className="mySwiper"
      >
            <div className="container mt-3">
                <h2 className='text-center'>Our Latest Books</h2>
                <div className="latest-books d-flex">
                    <div className="card bg-danger text-light m-2 text-center">
                        <i class="fa fa-book text-center fs-1 mt-3" aria-hidden="true"></i>
                        <div className="card-body">
                            <h4 className="card-title">Top Quality Books</h4>
                            <p className="card-text">Lorem ipsum dolor sit amet consectetur adipisicing elit. Perferendis, omnis.</p>
                        </div>
                    </div>
                </div>

            </div>
            </Swiper>
        </>
    )
}

export default LatestProducts;
